	function randomName(gender="random") {
		gender = "random" === gender ?
			["", "fe"].rand() + "male" :
			({ female: "female", f: "female", male: "male", m: "male" })[gender] ??
				["male", "female"].rand()
		return `${names.fnames[gender].rand()} ${names.lnames.rand()}`;
	}

	Reflect.defineProperty(randomName, "names", { get: () => names });

	randomName.gender = function getGender(name, form="string") {

		const fname = ["s", "str", "string", String].incl(form) ? name.slc(0, " ") : name.fname;;

		return names.fnames.male.incl(fname) ?
			"male" :
			names.fnames.female.incl(fname) ?
				"female" :
				"unknown";
	};

	randomName.split = function getSplittedNames(gender="random", usedict=false) {
		gender = "random" === gender ?
			["male", "female"].rand() :
			({ female: "female", f: "female",  male: "male", m: "male" })[gender] ??
				["male", "female"].rand()

		return (usedict ? dict : e => e) ( Object.fromEntries(
			arrzip(
				["fname", "lname", "gender"],
				this(gender).split(" ").concat([gender])
			)
		) )
	};

